import Navbar from "./components/layout/Navbar";
import UserItems from "./components/users/UserItems";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div>
        <Navbar title="GitHub Finder" icon="fab fa-github mr-2" />
        <UserItems />
      </div>
    );
  }
}
export default App;
